import React, { useState, useEffect } from 'react';
import styled from 'styled-components';
import backgroundImage from '../images/logo-5.svg';
import GrainEffect from './GrainEffect';

const Container = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  min-height: 100vh;
  width: 100vw;
  overflow: hidden;
  background-image: url(${backgroundImage});
  background-size: cover;
  background-position: center;
  background-repeat: no-repeat;
  position: relative; 
  z-index: 5;
  padding: 20px;
  box-sizing: border-box;
`;

const IframeContainer = styled.div`
  width: 100%;
  max-width: 600px;
  height: 70vh;
  max-height: 800px;
  overflow: hidden;
  border: 1px solid #ccc;
  border-radius: 16px;
  margin-bottom: 20px;

  @media (max-width: 768px) {
    width: 95%;
    height: 60vh;
  }

  @media (max-width: 480px) {
    width: 100%;
    height: 50vh;
  }
`;

const IframeWrapper = styled.div`
  width: 100%;
  height: 100%;

  @media (max-width: 768px) {
    transform: scale(0.7) translateY(-15%);
  }

  @media (max-width: 480px) {
    transform: scale(0.6) translateY(-20%);
  }
`;

const Button = styled.button`
  display: flex;
  align-items: center;
  gap: 8px;
  padding: 10px 20px;
  background-color: white;
  border: 1px solid rgba(0, 0, 0, 0.12);
  border-radius: 12px;
  color: #000;
  font-family: 'Poppins', sans-serif;
  font-size: 14px;
  font-weight: 600;
  cursor: pointer;
  box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
  z-index: 5;

  &:hover {
    background-color: #fff5f5;
    color: #ff4500;
    border-color: #ff4500;
    box-shadow: 0 6px 12px rgba(255, 69, 0, 0.3);
  }

  @media (max-width: 480px) {
    font-size: 12px;
    padding: 8px 16px;
  }
`;

const Generator = () => {
  const [number, setNumber] = useState(1);

  const generateNumber = () => {
    const randomNumber = Math.floor(Math.random() * 500) + 1;
    setNumber(randomNumber);
  };

  useEffect(() => {
    const handleKeyDown = (event) => {
      if (event.key === 'Enter') {
        generateNumber();
      }
    };

    window.addEventListener('keydown', handleKeyDown);

    return () => {
      window.removeEventListener('keydown', handleKeyDown);
    };
  }, []);

  return (
    <Container>
      <IframeContainer>
        <IframeWrapper>
          <iframe
            src={`https://sexpositions.club/positions/${number}.html`}
            title="Position Generator"
            style={{ width: '100%', height: '100%', border: 'none', pointerEvents: 'none' }}
          />
        </IframeWrapper>
      </IframeContainer>
      <Button onClick={generateNumber}>
        <span role="img" aria-label="Tour">ðŸ‘€</span> GÃ©nÃ©rer
      </Button>
      <GrainEffect />
    </Container>
  );
};

export default Generator;
